A method of applying a coating to a web using a system is disclosed, the method comprises a supply valve, a bypass valve, a nozzle, a web lifter and a controller to control said supply valve, said bypass valve and said nozzle, said method comprising: 
inputting to said controller the reference positions on said web where said supply valve is to open and close;inputting to said controller the reference positions on said web where said bypass valve is to open and close; 
inputting to said controller the reference positions on said web where said web lifter is to be actuated to move said web toward and way from said nozzle; 
moving said web past said nozzle; 
tracking the position of said web; and 
using said controller to control said supply valve, said bypass valve, said nozzle and said web lifter based on said inputted reference positions to deposit said coating on said web.

A display support arm assembly configured for pivotal movement with respect to an object, the display support arm assembly comprising: 
a display mounting plate; 
an arm coupled to the display mounting plate, the arm having a mounting portion and a body portion; 
the mounting portion adapted for attachment to the object and having a first washer and a second washer, the first washer being configured to be affixed to the object, and the second washer being affixed to the mounting portion of the arm; 
at least one of the first washer and the second washer defines a groove; and 
at least one gasket disposed between the first washer and the second washer and at least partly within the groove, the first washer being adapted to rotate with respect to the second washer; 
wherein the at least one gasket, the first washer, and the second washer are configured to resist unintended rotational movement of the arm relative to the object.

A method of key distribution involving: 
storing, at a home location register, key material related to mobile stations associated with the home location register; 
storing, at a first visited location register associated with a first site in a first zone, key material related to a first mobile station of the mobile stations associated with the home location register; 
when the first mobile station roams to a second site in a second zone associated with a second visited location register, encrypting the key material related to the first mobile station with an interkey, yielding encrypted key material, wherein the interkey is used only by infrastructure system devices other than a mobile station for encrypting at least the key material for transport between at least the first and second zones; and 
forwarding the encrypted key material to the second visited location register.

A method of key distribution including: 
generating a plurality of encryption keys and associating each encryption key with one geographical area of a plurality of geographical areas; 
forwarding each encryption key to one or more base stations in the geographical area associated with the encryption key; 
determining at least one of the plurality of geographical areas that is adjacent to a first geographical area, yielding one or more adjacent geographical areas; and 
forwarding an encryption key for at least one of the one or more adjacent geographical areas to at least one base station covering the first geographical area.
